import React from 'react';
import './Navbar.styles.css';
import * as FaIcons from 'react-icons/fa';
function Navbar () {
    return(
        <>
            <div className="navbar">
                <Link to='#' className='menu-bars'>
                    <FaIcons.Fabars/>
                </Link>
            </div>
        </>
    )
}

export default Navbar;
